import Card from 'react-bootstrap/Card';

function Question() {
  return (   
    <>
      <Card.Body style={{color:'white', textAlign:'center'}}>¿Tu personaje es ficticio?</Card.Body>
      <Button style={{alignItems:'center'}} variant="outline-warning">〤</Button>
      <Button variant="outline-warning">✓</Button>

    </>
  );
}

export default Question;
